  "features": "<h1 class=\"a-size-base-plus a-text-bold\" data-mce-fragment=\"1\">About this item</h1>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\" data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">GPS + Cellular model lets you call, text, and get directions without your phone</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Measure your blood oxygen with an all-new sensor and app</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Check your heart rhythm with the ECG app</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">The Always-On Retina display is 2.5x brighter outdoors when your wrist is down</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">S6 SiP is up to 20% faster than Series 5</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">5GHz Wi-Fi and U1 Ultra Wideband chip</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Track your daily activity on Apple Watch and see your trends in the Fitness app on iPhone</span></li>\n</ul>\n<div class=\"a-row a-expander-container a-expander-inline-container\" aria-live=\"polite\" data-mce-fragment=\"1\">\n<div class=\"a-expander-content a-expander-extend-content a-expander-content-expanded\" aria-expanded=\"true\" data-mce-fragment=\"1\">\n<ul class=\"a-unordered-list a-vertical a-spacing-none\" data-mce-fragment=\"1\">\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Measure workouts like running, walking, cycling, yoga, swimming, and dance</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Swimproof design</span></li>\n<li data-mce-fragment=\"1\"><span class=\"a-list-item\" data-mce-fragment=\"1\">Sync and stream music, podcasts, and audiobooks</span></li>\n</ul>\n<h2 data-mce-fragment=\"1\"><strong data-mce-fragment=\"1\">  AIRPODS PRO 3rd Gen.</strong></h2>\n<p style=\"text-align: center;\" data-mce-fragment=\"1\">Apple Earphones - Active Noise Cancellation - High-Quality Sound - Adaptive Equalisation - Ambient Sound Mode - IPX4 - Easy Setup - Quick Charge - Wireless Charging - Bluetooth 5.0</p>\n<p data-mce-fragment=\"1\"> </p>\n<h3 style=\"text-align: center;\" data-mce-fragment=\"1\">- Extraordinary Sound Quality</h3>\n<p style=\"text-align: center;\" data-mce-fragment=\"1\">The new<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">Apple Airpods Pro - Bluetooth Headphones</strong><span data-mce-fragment=\"1\"> </span>is one of the most awaited models. These new Bluetooth headphones feature<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">active noise cancellation</strong><span data-mce-fragment=\"1\"> </span>technology to immerse you in what you're listening to. You will also be able to enjoy their<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">ambient sound mode</strong>.</p>\n<h3 style=\"text-align: center;\" data-mce-fragment=\"1\">- Active noise cancellation technology</h3>\n<p style=\"text-align: center;\" data-mce-fragment=\"1\">They adapt to the anatomy of your ear using active noise cancellation technology, which blocks out the sounds around you so that nothing or no one can distract you. The<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">high dynamic range amplifier</strong><span data-mce-fragment=\"1\"> </span>produces incredibly clear sounds and increases battery life. And with adaptive equalization, it adjusts the music according to the shape of your ear. Everything is ready to sound great!</p>\n<h3 style=\"text-align: center;\" data-mce-fragment=\"1\">- Quick Charge, for a longer battery life</h3>\n<p style=\"text-align: center;\" data-mce-fragment=\"1\">They have a<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">long battery life</strong><span data-mce-fragment=\"1\"> </span>thanks to their high-quality<strong data-mce-fragment=\"1\"><span data-mce-fragment=\"1\"> </span>charging case</strong>, which features<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">quick charge and</strong><span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">wireless charging</strong><span data-mce-fragment=\"1\"> </span>via Qi technology. </p>\n<h3 style=\"text-align: center;\" data-mce-fragment=\"1\">- For Sport lovers, with several sizes</h3>\n<p style=\"text-align: center;\" data-mce-fragment=\"1\">These ultra-lightweight headphones adapt to the anatomy of your ear using active noise cancellation technology and different ear tips. These ear tips are also available in three sizes. Inside, they are conically shaped. Designed with<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">IPX4 water and sweat resistance</strong>, you will be able to wear them while playing your favourite sport.</p>\n<h3 style=\"text-align: center;\" data-mce-fragment=\"1\">- Easy Setup</h3>\n<p style=\"text-align: center;\" data-mce-fragment=\"1\">The new<span data-mce-fragment=\"1\"> </span><strong data-mce-fragment=\"1\">Apple Airpods Pro - Bluetooth Headphones features</strong><span data-mce-fragment=\"1\"> </span>the new Apple H1 chip. It offers incredibly low audio latency. With its built-in pressure sensor in the earpiece's elongated part, you can control calls and music, and switch between active noise cancellation and ambient sound mode.</p>\n<h3 style=\"text-align: center;\" data-mce-fragment=\"1\">- With the help of Siri</h3>\n<p data-mce-fragment=\"1\">You can also activate the Message Alert option, which Siri will read aloud to you when using the AirPods. And with Shared Audio, you can pair two pairs of AirPods and play games, watch a film and listen to a song with anyone you want. Easy to set up and connect with other Bluetooth headphones and devices.</p>\n<p data-mce-fragment=\"1\"><br data-mce-fragment=\"1\">• Volume / Brightness / BT Settings<br data-mce-fragment=\"1\">• Both Android And iOS Connection</p>\n</div>\n</div>",
