  "features": "<p>Product description:-</p>\n<p><br data-mce-fragment=\"1\">• Truly wireless sport headphones for total freedom of movement,<br data-mce-fragment=\"1\">packed full of technology that makes music sound clear and<br data-mce-fragment=\"1\">powerful and Earbuds are sweat and weather resistant (with an IPX4<br data-mce-fragment=\"1\">rating) and come with 3 different pairs of stay hear + sport tips (in<br data-mce-fragment=\"1\">sizes S/M/L) that provide a comfortable and secure fit<br data-mce-fragment=\"1\">• Bluetooth Range :As long as the right earbud and the device are<br data-mce-fragment=\"1\">within 9 m (30 ft) of each other, the right earbud will play audio from<br data-mce-fragment=\"1\">the source device. The left earbud will stay connected to the right<br data-mce-fragment=\"1\">earbud as long as it is out of the case, charged and within 9 m (30<br data-mce-fragment=\"1\">ft) of the right earbud<br data-mce-fragment=\"1\">Quiet comfort 35 wireless headphones Il are engineered with world-<br data-mce-fragment=\"1\">class noise cancellation and now they're even better. You can<br data-mce-fragment=\"1\">control music, send and receive texts, and get answers using just<br data-mce-fragment=\"1\">your voice. Just press and hold the action button, and start talking.<br data-mce-fragment=\"1\">With QC 35 headphones I, you can be free from wires by connecting<br data-mce-fragment=\"1\">easily to your devices with Bluetooth and NFC pairing and voice<br data-mce-fragment=\"1\">prompts walk you through the connection. The multi-function<br data-mce-fragment=\"1\">button continues to offer access to your phone's default virtual<br data-mce-fragment=\"1\">assistant, like Siri. Volume-optimized EQ gives you balanced audio<br data-mce-fragment=\"1\">performance at any volume, while a noise-rejecting dual-<br data-mce-fragment=\"1\">microphone system provides clearer calls, even in noisy<br data-mce-fragment=\"1\">environments. They feature up to 20 hours of wireless listening per<br data-mce-fragment=\"1\">charge and are designed with premium materials that make them<br data-mce-fragment=\"1\">lightweight and comfortable for all-day wear and the Bose Connect<br data-mce-fragment=\"1\">app helps you set your preferred level of noise cancellation, unlock<br data-mce-fragment=\"1\">more features and access future updates. Get caught with a low<br data-mce-fragment=\"1\">battery? The included cable lets you plug in and keep the music<br data-mce-fragment=\"1\">playing. Available in black or silver.<br data-mce-fragment=\"1\">Specification:<br data-mce-fragment=\"1\">Dimensions/weight without the cable:</p>\n<p><br data-mce-fragment=\"1\">Headphones:18 cm H x 17 cm W x 8.1 cm D (0.24 kg)<br data-mce-fragment=\"1\"></p>\n<p>Audio cable:1.2 m<br data-mce-fragment=\"1\"></p>\n<p>USB cable:30.5 cm</p>",
